import React from 'react';
import { CartListProduct } from "./CartListProduct"

export const CartGrid = props => {
    const productKey = props.newBoxs.id;
    const findKey = props.newBoxs.find(el => el.image.includes(productKey))

    const list = props.newBoxs.slice(0, props.limit);
    const showProduct = list.map(newBoxs => { 
        return findKey ? <CartListProduct
            key={newBoxs.id}
            newBoxs={newBoxs}
        /> : ""
    });

    return (
        <div className='light-cart-list'>
            {showProduct}
        </div>
    );
}
